// C:\CamilaSerniotti-TPFinal\frontend\src\App.jsx
import React from 'react';
import { Routes, Route, Link } from 'react-router-dom'; 
import './App.css'; 

// Importación de componentes
import TodoList from './components/TodoList'; 
import Login from './components/Login';       

function App() {
  return (
    <div className="App">
      <nav style={{ marginBottom: '20px', padding: '10px', backgroundColor: '#ecf0f1' }}>
        <Link to="/" style={{ marginRight: '15px', color: '#2980b9' }}>[Ver Agenda]</Link>
        <Link to="/login" style={{ color: '#2980b9' }}>[Ver Login]</Link>
      </nav>
      
      <Routes>
        <Route path="/" element={<TodoList />} /> 
        <Route path="/login" element={<Login />} />
      </Routes>
    </div>
  );
}

export default App;
